      -webkit-background-size: cover;
      -moz-background-size: cover;
      -o-background-size: cover;
      background-size: cover;
      -webkit-box-shadow: 10px 12px 29px -1px rgba(75, 33, 255, 0.69);
      -moz-box-shadow: 10px 12px 29px -1px rgba(75, 33, 255, 0.69);
      box-shadow: 10px 12px 29px -1px rgba(75, 33, 255, 0.69); }
  .home .content-area .profile-section {
    vertical-align: top;
    display: inline-block; }

* {
  box-sizing: border-box; }

html,
body {
  font-size: 18px;
  background: #4b21ff;
  font-family: 'Barlow Semi Condensed', sans-serif;
  height: 100%; }
